//Method to call buildXML to build the queries for each objectId
def BuildXML() {

    project = testRunner.testCase.testSuite.project
    testcase = testRunner.testCase.testSuite.project.testSuites["CreateCESEHierarchy"].getTestCaseByName("BuildXML")
    WsdlTestCaseRunner runner = new WsdlTestCaseRunner(testcase,null )
    runner.runTestStepByName("buildXML")	
}

//Method to call run the XMLs built from last step
def RunXML() {

	testStepName = testRunner.testCase.testSuite.getPropertyValue("testStepName")
	testcase = testRunner.testCase.testSuite.project.testSuites["CreateCESEHierarchy"].getTestCaseByName("Output")
     WsdlTestCaseRunner trunner = new WsdlTestCaseRunner(testcase,null)
     trunner.runTestStepByName(testStepName)
}

//Method to getResponses
def GetResponse() {

    testStepName = testRunner.testCase.testSuite.getPropertyValue("testStepName")
    response = testRunner.testCase.testSuite.project.testSuites["CreateCESEHierarchy"].testCases["Output"].testSteps[testStepName].testRequest.response
    testStep =  testRunner.testCase.testSuite.project.testSuites["CreateCESEHierarchy"].testCases["Output"].testSteps[testStepName]
    holder  = groovyUtils.getXmlHolder(testStep.testRequest.responseContent)
              holder.declareNamespace("env","http://schemas.xmlsoap.org/soap/envelope/")
              holder.declareNamespace("ns1","http://xmlns.fedex.com/CVM")
              holder.declareNamespace("n1","http://xmlns.fedex.com/CVM")
}

