  {
                testRunner.testCase.testSuite.setPropertyValue("methodName", "upsertAcct")
                BuildXML()
                RunXML()
                GetResponse()
                code = response.getStatusCode()
                if (code == 200)
                  {
               	testRunner.testCase.testSuite.setPropertyValue("methodName", "aggregateAcct")
                  	BuildXML()
                  	RunXML()
                  	GetResponse()
                  	code = response.getStatusCode()
                  	if (code == 200)
                  	  {
                  	  	ciamAccountNum = testRunner.testCase.testSuite.getPropertyValue("ciamAccountNum")
                  	  	GetLinkResnCd()

                  	  	//Call Validate Hierarchy
                         testcase = testRunner.testCase.testSuite.project.testSuites["CreateCESEHierarchy"].getTestCaseByName("ValidateHierarchy&CompareWBaseline")
                         WsdlTestCaseRunner trunner = new WsdlTestCaseRunner(testcase,null)
                         trunner.runTestStepByName("validateHierarchy") 
                  	  }
                  }
  }


//Create Accounts
else {
       expectedRuleCode = testRunner.testCase.testSuite.getPropertyValue("expectedRuleCode")
       for (i in 0..1)
          {
             testRunner.testCase.testSuite.setPropertyValue("methodName", "enterpriseAdd")
             testStepNumber = testRunner.testCase.testSuite.getPropertyValue("testStepNumber")
             uniqId = testStepNumber + "_" + i
             testRunner.testCase.testSuite.setPropertyValue("testStepNumber", uniqId)
             BuildXML()
             RunXML()
             GetResponse()
             code = response.getStatusCode()
             if (code == 200)
               {
                            ciamAccountNum = holder.getNodeValue("//ns2:enterpriseAddResponse/accountNumberList/ns2:accountNumber")
                            testRunner.testCase.testSuite.setPropertyValue("ciamAccountNum", ciamAccountNum)
                            //Aggregate the account, doing this as workflow has shut down their receivers in L2, but it should happen automatically in real life
                            sleep(12000)
                            if (ciamAccountNum != null && ciamAccountNum.length() > 0)
                              {
                                testRunner.testCase.testSuite.setPropertyValue("methodName", "aggregateAcct")
                                BuildXML()
                                RunXML()
                                GetResponse()
                                code = response.getStatusCode()
                                if (code == 200)
                                  {
                                    GetLinkResnCd()

                                    //Call Validate Hierarchy
                                    scenarioType = testRunner.testCase.testSuite.getPropertyValue("scenarioType")
                                    if (scenarioType!='U')
                                      {
                                        testcase = testRunner.testCase.testSuite.project.testSuites["CreateCESEHierarchy"].getTestCaseByName("ValidateHierarchy&CompareWBaseline")
                                        WsdlTestCaseRunner trunner = new WsdlTestCaseRunner(testcase,null)
                                        trunner.runTestStepByName("validateHierarchy")
                                      }                                 
                                  }            
                             }
                           else
                               {
                                 rowId = testRunner.testCase.testSuite.getPropertyValue("rowId")
                                 log.error ("Account was not created for spreadsheet row Id ${rowId}\n")   
                                }
               }
             else
                 {
                              rowId = testRunner.testCase.testSuite.getPropertyValue("rowId")
                              log.error ("Account was not created for spreadsheet row Id ${rowId}\n")   
           }

             if (expectedRuleCode != 'AggrAdd028' && expectedRuleCode != 'AggrAdd029')
               {
                        break   
               }
          }
}

