//Method to getLink Reason Code from CVM DB
def GetLinkResnCd() {

	//Connect to DB
     sql = Sql.newInstance( "${OracleDBConn}", "CVM_UPD_APP",
                            "${OracleDBPwd}", "oracle.jdbc.driver.OracleDriver" )

     //CustViewCd and custModelCd 
     sql.eachRow("SELECT PROP_VALUE_DESC FROM CUST_REL_PROPERTY WHERE REL_ID IN" +
                 "(SELECT REL_ID FROM CUST_REL WHERE TYPE_CD='PRNT' AND CUST_VIEW_CD='CORE' AND EXPR_TMSTP > CURRENT_TIMESTAMP+6 AND OBJ_ID IN" +     
                 "(SELECT OBJ_ID FROM CUST_EXT_ID WHERE TYPE_CD='ACCT.ENT' AND EXTERNAL_ID_NBR='${ciamAccountNum}'))" +
                 "AND PROP_NM='LINK_RESN_CD' AND EXPR_TMSTP > CURRENT_TIMESTAMP+6")
            {
          	actualRuleCode = it.PROP_VALUE_DESC
          	testRunner.testCase.testSuite.setPropertyValue("actualRuleCode", actualRuleCode)
            }



}

