  	  	   	  	acctType = testRunner.testCase.testSuite.getPropertyValue("acctType")
  	  	   	  	if (acctType == 'BUS' && expectedRuleCode != 'AggrAdd033')
  	  	   	  	  {
  	  	   	  	    if (actualGeId == targetGeId)
  	  	   	  	      {
