//Method to mask date/time and other dynamic fields
def MaskField (timestampField, holderName) {

    if (timestampField!= null && timestampField.size() > 0)
      {
        for (k in timestampField)
           {
             xmlUtils.setNodeValue(k,"DO NOT COMPARE")	
            }
       holderName.updateProperty()
      }
}

//Method to write to output files
def WriteOutFile(respType, testStepName) {

    file1 = new PrintWriter ("G:/Regression/Phase2RT/${respType}/Actual/getAncestors_" + rowId + "_response.xml")
    file1.println(holder.xml)
    file1.flush()
    file1.close()
}


