def GetResponse() {

    testStepName = testRunner.testCase.testSuite.getPropertyValue("testStepName")
    response = testRunner.testCase.testSuite.project.testSuites["CreateCESEHierarchy"].testCases["Output"].testSteps[testStepName].testRequest.response
    testStep =  testRunner.testCase.testSuite.project.testSuites["CreateCESEHierarchy"].testCases["Output"].testSteps[testStepName]
    holder  = groovyUtils.getXmlHolder(testStep.testRequest.responseContent)
              holder.declareNamespace("env","http://schemas.xmlsoap.org/soap/envelope/")
              holder.declareNamespace("ns1","http://xmlns.fedex.com/CVM")
              holder.declareNamespace("n1","http://xmlns.fedex.com/CVM")
} 
//Method to do file compares
def DoFileCompare(holder,testStepName) {

	   baseFile1 = new File("G:/Regression/Phase2RT/${respType}/Baseline/getAncestors_" + rowId + "_response.xml")
        if (!baseFile1.exists())
          {
            log.error("Input/Baseline File for ${respType} ${baseFile1} not found!")
            //log.info("Input/Baseline File for ${respType}  ${baseFile1} not found!")    
            noFilesList = testRunner.testCase.testSuite.getPropertyValue("noFileList")
            noFilesList = noFilesList + ("Input/Baseline File,${baseFile1} not found!for $testStepName}")
            testRunner.testCase.testSuite.setPropertyValue("noFilesList", noFilesList)
          }
        else
          {
            baseXML1 = baseFile1.getText()
            XMLUnit.setIgnoreWhitespace(true)
            xmlDiff1 = new Diff(baseXML1,holder.xml)           
            if (xmlDiff1.identical())
              {
               log.info("Content Match Assertion for ${testStepName} passes for ${respType}")
              }
            else 
               {
             	//testRunner.fail("Content Match Assertion for ${testStepName} failed for ${respType}")
             	log.error("Content Match Assertion for ${testStepName} failed for ${respType}")
             	assertionList = testRunner.testCase.testSuite.getPropertyValue("assertionList")
             	assertionList = assertionList + testStepName
             	testRunner.testCase.testSuite.setPropertyValue("assertionList", assertionList)
             	detDiff1 = new DetailedDiff(xmlDiff1).toString()
             	logFileName = testRunner.testCase.testSuite.getPropertyValue("logFileName")
             	File logFile = new File (logFileName)
               logFile.append("********Content Match Assertion for  ${testStepName}  failed for ${respType} with the following differences**********\n\n\n")
               logFile.append(detDiff1)
               logFile.append("\n")
             }
          }

}

