def AddTestStep(operName) { 
                        interfaceName= testRunner.testCase.testSuite.project.getInterfaceAt(0).getName()
                        operationName = "upsertCustomerObjects"
                        op = testRunner.testCase.testSuite.project.interfaces[interfaceName].operations[operationName]
                        config = com.eviware.soapui.impl.wsdl.teststeps.registry.WsdlTestRequestStepFactory.createConfig( op, testStepName )
                        testRunner.testCase.testSuite.project.testSuites["CreateCESEHierarchy"].testCases["Output"].addTestStep( config )


                        request2 = testRunner.testCase.testSuite.project.testSuites["CreateCESEHierarchy"].testCases["Output"].getTestStepByName("${testStepName}")
                        request2.getProperty("request").setValue(workingReq)

                        endPointURL = testRunner.testCase.testSuite.project.getPropertyValue("endPointURL")
                        if (methodName == "enterpriseAdd" || methodName == "acctMaint"|| methodName == "enterpriseAddGO")
                          {
                          	endPointURL = testRunner.testCase.testSuite.project.getPropertyValue("ciamWSEndPoint")
                          }
                        testRunner.testCase.testSuite.project.testSuites["CreateCESEHierarchy"].testCases["Output"].getTestStepByName("${testStepName}").getHttpRequest().setEndpoint(endPointURL)
}


