def setReqValues(fieldName,fields) {

     if (fields!= null && fields.length()>0)
       {  

     	holder.setNodeValue("//${fieldName}","${fields}");

        }
     else holder.remove("//${fieldName}");
       	holder.updateProperty()

    	}

